export function getImageList(album) {
  if (album == "cali") {
    return itemData;
  }
  if (album == "nyc") {
    return nycImages;
  }
}

//nyc
const nycImages = [];
for (let i = 1; i <= 23; i++) {
  console.log("./albums/nyc/nyc" + i + ".jpg");
  nycImages.push({
    img: require("./albums/nyc/nyc" + i + ".jpg"),
    title: "nyc" + i,
  });
}
